package com.tranphunguyen.demobindingdata

import android.databinding.BindingAdapter
import android.databinding.DataBindingUtil
import android.databinding.DataBindingUtil.setContentView
import android.support.v7.app.AppCompatActivity
import android.os.Bundle
import android.view.View
import android.widget.ImageView
import com.bumptech.glide.Glide
import com.tranphunguyen.demobindingdata.databinding.ActivityMainBinding

@BindingAdapter("getImageFromUrl")
fun getImageFromUrl(view : ImageView,url : String ) {
    Glide.with(view).load(url).into(view)
}

class MainActivity : AppCompatActivity() {

    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        setContentView(R.layout.activity_main)

        val presenter = Presenter()
        val user = UserBinable()
        val url = "data:image/jpeg;base64,"
        val binding = DataBindingUtil.setContentView<ActivityMainBinding>(this, R.layout.activity_main)

        binding.presenter = presenter
        binding.user = user
        binding.url = url
    }
}
